import "../styles/button.css"

const Button = ({text, image, width}) => {

    const customStyle = {
        width: width
    }

    return (
        <div className="btn-color" style={customStyle} >
            <div className="text-start">
            <img src={image} alt="" />
            <span className="ps-2">{text}</span>
            </div>
        </div>

    )
}

export default Button;
